import React from 'react';

const Home = () => {
    return (
        <div className="home">
            <h1>Welcome to the F1 Telemetry Website</h1>
            <p>
                Explore telemetry data and graphs from Formula 1 races.
            </p>
            <p>
                Use the navigation to view detailed dashboards and insights.
            </p>
        </div>
    );
};

export default Home;
